import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu'; // Import MenuIcon
import './SideNav.css'; // Import the CSS file for styling

const SideNav = ({ darkMode }) => {
  const [visible, setVisible] = useState(false);

  const toggleNav = () => {
    setVisible(!visible);
  };

  return (
    <>
      <div className={`side-nav ${visible ? 'visible' : ''} ${darkMode ? 'dark' : 'light'}`}>
        <ul>
          <li>
            <Link to="/" onClick={toggleNav}>
              Home
            </Link>
          </li>
          <li>
            <Link to="/about" onClick={toggleNav}>
              About
            </Link>
          </li>
          <li>
            <Link to="/contact" onClick={toggleNav}>
              Contact
            </Link>
          </li>
        </ul>
      </div>
      <div className="menu-icon" onClick={toggleNav} style={{ position: 'fixed', top: '20px', left: '20px', zIndex: 1100, cursor: 'pointer' }}>
        <MenuIcon style={{ color: darkMode ? 'white' : 'black' }} />
      </div>
    </>
  );
};

export default SideNav;
